import React, {Component} from 'react';
import PostData from './post.json';

class Postlist extends Component{


//var obj = JSON.parse(PostData);


delete(event){
      var parent = document.getElementById('title');
      var child = document.getElementById('t2');
      parent.removeChild(child);

}


render() {
    return (
      <div>
        <h1>todo json App </h1>
        {PostData.map((Postdetails,index)=>{
            return <div>
                    <div id="title">
                      <div id="t2">
                        <h2 id="t1">{Postdetails.title} <span onClick={this.delete}>X</span></h2>
                        <p id="t1">{Postdetails.content}</p>
                      </div>
                    </div>
                  </div>
          })}
      </div>
    )
  }
}

export default Postlist;
